import React from 'react'
import {Link} from 'react-router-dom'
import axios from 'axios'

const authAxios=axios.create({
	headers: {
		Authorization: 'Token 41753da4b54125d03cc04e814c071435c0deb35'
	}
});

class Home extends React.Component {
	constructor(props) {
		super(props)

		this.state = {
			context:{},
			error:''
		}
	}
	componentDidMount() {
		authAxios.get('http://localhost:8000/')
		.then(
			(response) =>{
				this.setState({context:response.data})
				console.log(context)
			}
		)
		.catch(
			(error) =>{
				this.setState({error:error.message})
				console.log(error)
			}
		)
	}
	render() {
		return (
			<div>
				Check Console
			</div>
		)
	}
}

export default Home
